import React, {Component} from 'react'
import {StyledListItem, StyledList} from "./TodoList.styled";

class TodoList extends Component {

     state = {
        done: false
    };


    onLabelClick = () => {
        this.setState(({done}) => {
            return {
                done: !done,
            }
        })
    };


    render() {
        let {data} = this.props;
        return (
            <div>

                {data.map(({label, id}) => {
                    return (
                        <StyledListItem key={id} done = {this.state.done}>
                            <span  onClick={() => this.onLabelClick()}>{label}</span>
                        </StyledListItem>
                    )
                })}

                <StyledList>

                </StyledList>
            </div>
        )
    }
}

export default TodoList;
